import axios from 'axios'
import Constants from '@/components/common/constants'
import { transform } from 'ol/proj.js'

const ADDRESS_URL = Constants.ADDRESS_TO_COORDINATE_URL
const GEO_DATA_URL = Constants.ADDRESS_TO_GEO_DATA_URL
const REVERSE_GEO_DATA_URL = Constants.REVERSE_TO_GEO_DATA_URL

let parsingUrl = function(url, param) {
  let pUrl = url

  if (param.addressName !== undefined) {
    pUrl = pUrl.replace(Constants.ADDRESS_NAME, param.addressName)
  }

  if (param.serviceCode !== undefined) {
    pUrl += `&data=${param.serviceCode}`
  }

  if (param.point !== undefined) {
    let gps = transform([Number(param.point.x), Number(param.point.y)], 'EPSG:4326', 'EPSG:3857')
    console.log('[parsingUrl] gos : ', gps)
    pUrl += `&geomFilter=point(${gps[0]} ${gps[1]})`
  }

  if (param.longitude !== undefined) {
    pUrl = pUrl.replace(Constants.ADDRESS_LONGITUDE, param.longitude)
  }

  if (param.latitude !== undefined) {
    pUrl = pUrl.replace(Constants.ADDRESS_LATITUDE, param.latitude)
  }
  return pUrl
}

